using namespace std;

void sendMessageToAllComputersInNetwork(string message)
{
 vector<string> networkComputers;
 //get a list of all computers in the network and store in the vector called "networkComputers"

 for(int i = 0; i < networkComputers.size(); i++)
 {
  //send the "message" string to each computer in the network
  cout << "Computers in network: receiving message: " << message << endl;
  sendMessage(networkComputers[i], message);
